import React from 'react';
import { useHistory } from 'react-router-dom'; // Use useHistory instead of useNavigate
import './Login.css';
import due from './image/due.jpg';
import cutm from './image/cutm.png';

const Login = () => {
  const history = useHistory(); // Use useHistory to access history for navigation

  const handleLogin = () => {
    // Perform login logic here
    // Once logged in, redirect to the profile page
    history.push('/profile');
  };

  return (
    <div>
      <div className='main'>
        <div className='title'> {/* Corrected typo */}
          <img src={cutm} alt='cutm' className='cutm' />
          <h1>
            <i>
              <u>Online</u>
            </i>
          </h1>
          <h2>
            <i>
              <u>No Due</u>
            </i>
          </h2>
        </div>
        <div className='sub'>
          <div className='due_b'>
            <img src={due} alt='due' className='due' />
          </div>
          <div className='info'>
            <input type='text' placeholder='Username' className='name' />
            <br />
            <input type='password' placeholder='Password' className='pass' />
            <div className='login_button'>
              <button onClick={handleLogin}>Login</button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
